import React from "react";

export default function MenuBar(){

    return(
        <div className="menu">
            <div class="container text-center">
                <div class="row">
                    <div class="col">
                        1 of 3
                    </div>
                    <div class="col-6">
                        2 of 3 (wider)
                    </div>
                    <div class="col">
                        3 of 3
                    </div>
                </div>
            </div>
            
        </div>
    );

}
